import React from 'react';
import './App.css';
import TablePage from './TablePage';
import EditPage from './EditPage';
import { Route,Routes } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path="/" element={<TablePage/>}/>
      <Route path="/edit" element={<EditPage/>}/>
    </Routes>



  );
}

export default App;
